export const createOrder = (productId, orderQuantity) => {
    fetch('http://localhost:5001/orders/newOrder', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        productId,
        orderQuantity,
      }),
    })
      .then((response) => response.json())
      
      .catch((error) => {
        console.error('Error creating the order:', error);
      });
  };
